import React from 'react';

import classes from './Logo.module.css';

import logo from '../../../assets/Header/logo.png';

const Logo = (props) => {

    let colorClass = [classes.Logo];

    switch (props.color) {
        case "lightBlue":
            colorClass.push(classes.lightBlue);
            break;
        case "white":
            colorClass.push(classes.white);
            break;
        default:
            colorClass.push(classes.black);
            break;    
    }

    return (
        <img src={logo} className={colorClass.join(' ')} alt={Logo}/>
    );

};

export default Logo;
